import React from "react";
import AsyncStorage from '@react-native-async-storage/async-storage';
import { Link } from "react-router-dom";
import styled from "styled-components";

const Header = () => {

const navigate = useNavigate();

const Logout = () => {
    AsyncStorage.removeItem("token");
    navigate("/");
    }

    return( 
    <>
        <Wrapper>
        <Link to="/">project</Link>
        <Sort>
        {!localStorage.getItem("token") &&
            (<>
                <Font><Link to="../Loginpage"><ColorWhite>로그인</ColorWhite></Link></Font>
                <Font><Link to="../SignUppage"><ColorWhite>회원가입</ColorWhite></Link></Font>
            </>
            )}
            {localStorage.getItem("token") && 
            (<>
            <Font><Link to="../writepage"><ColorWhite>글쓰기</ColorWhite></Link></Font>
            <Font><Link to="../Mypage"><ColorWhite>마이페이지</ColorWhite></Link></Font>
            <Font><ColorWhite onClick={Logout}>로그아웃</ColorWhite></Font>
            </>
                )}
            </Sort>
        </Wrapper>
        </>
        )
    }

export default Header

const ColorWhite = styled.div`
  color: white;
  cursor: pointer;
  text-decoration: none;
`

const Img = styled.img`
  width: 100px;
  margin-top: 20px;
  margin-bottom: 20px;
  margin-left: 45px;
`

const Wrapper = styled.div`
  width: 100vw;
  display: flex;
  align-items: center;
  justify-content: space-between;
  border: 0px solid black;
  background-color: #000000cf;
  `

const Sort = styled.div`
  display: flex;
  margin-right: 35px;
`

const Font = styled.div`
  margin-left: 15px;
  font-size: 20px;
  font-family: 'DoHyeon';
`
